import {Card,Avatar,Button} from "antd";

const UserProfile = ()=>{
    return (
        <Card
        actions={[
            <div key="twist"> 짹짹 <br/> @</div>,
            <div key="followings">팔로잉 <br/> @</div>,
            <div key="followings">팔로워 <br/> @</div>
        ]}>
            <Card.Meta
            avatar={<Avatar> AY</Avatar>}
            title="ahyeon"
            />
            <Button> 로그아웃</Button>

        </Card>
    );
}
export default UserProfile;
